import React from 'react';
import styled from 'styled-components';
import { FaFacebookF, FaTwitter, FaWhatsapp } from 'react-icons/fa';

const Icons = () => {
    return (
        <SIcons>
            <FaFacebookF />
            <FaTwitter />
            <FaWhatsapp />
        </SIcons>
    );
};

const SIcons = styled.div`
    svg {
    }
`;

export default Icons;
